(1, 'Continental', 'Continental  ExtremeContact DWS 06 Plus', 157.99, 12, '225/45ZR17', 'Blackwall', 225, 30, 20, '', 'A4', 'Base', 'https://static.tirerack.com/content/dam/tires/continental/co_extremecontact_dws_06_plus_full.jpg?imwidth=440&impolicy=tow-pdp-main,https://static.tirerack.com/content/dam/tires/continental/co_extremecontact_dws_06_plus_tread.jpg?imwidth=1320&impolicy=tow-pdp-main', '{\r\n  \"Size\": \"225/45ZR17\",\r\n  \"ServiceDescription\": \"91W\",\r\n  \"LoadRange\": \"SL\",\r\n  \"EcoFocus\": \"N/A\",\r\n  \"UTQG\": \"560 AA A\",\r\n  \"MaxLoad_lbs\": 1356,\r\n  \"MaxInflationPressure_psi\": 51,\r\n  \"TreadDepth_32nds\": 10,\r\n  \"TireWeight_lbs\": 22,\r\n  \"RimWidthRange_in\": \"7-8.5\",\r\n  \"MeasuredRimWidth_in\": 7.5,\r\n  \"SectionWidth_in\": 8.9,\r\n  \"TreadWidth_in\": 7.4,\r\n  \"OverallDiameter_in\": 25,\r\n  \"RevolutionsPerMile\": 832,\r\n  \"CountryOfOrigin\": \"BR\"\r\n}', 'The ExtremeContact DWS 06 PLUS is Continental\'s Ultra High Performance All-Season tire developed for drivers of sports cars, sports coupes, performance sedans, SUVs and CUVs. Designed to improve upon key metrics compared to its predecessor, like braking in dry and wet, along with increased traction in snow and ice, the ExtremeContact DWS 06 PLUS is built to deliver skillful handling and high-speed capability with increased confidence for inclement weather, even in light snow.\r\n\r\nContinental ExtremeContact DWS 06 Plus Callouts\r\nFeaturing an updated, performance-tuned all-season tread compound molded into an updated asymmetric tread design and utilizing SPORTPLUS+ Technology, the ExtremeContact DWS 06 PLUS is built for enhanced handling and braking performance. Macro-Blocks and Chamfered block edges help improve ultimate dry road traction and provide increased cornering responsiveness. Generous high angle and circumferential grooves help evacuate water from the contact patch for increased hydroplaning resistance. 3D sipes help retain handling precision while increasing the number of biting edges for improved wet traction, while X-Sipes are utilized to improve lateral and longitudinal grip in inclement weather. Traction grooves within the circumferential channels further enhance winter weather traction by improving snow-to-snow traction.\r\n\r\nExtremeContact DWS 06 PLUS tires feature an Alignment Verification System to help identify vehicle misalignment concerns early in the tire\'s life before wear patterns form. The system also confirms suitability for different driving conditions through Tuned Performance Indicators. Tuned Performance Indicators are visible letters molded into the second rib from the outboard shoulder to alert drivers of the tire\'s performance levels. A visible \"DWS\" indicates the tire has appropriate tread depth for dry conditions, as well as wet roads and snow. After the \"S\" has worn away, the remaining \"DW\" indicates the tire only has appropriate tread depth for dry and most wet road conditions. After the \"W\" and \"S\" have both worn away, the remaining \"D\" indicates the tire has appropriate tread depth for dry conditions only.\r\n\r\nThe ExtremeContact DWS 06 PLUS incorporates a high strength, 2 ply sidewall construction for improved resistance to damage, along with a Sport Sidewall Insert for increased handling responsiveness. Continental\'s new high-strength, triple action, hybrid cap ply helps combine the positive attributes of a stiffer cord material for improved handling characteristics, while simultaneously retaining the benefits of a more flexible cord, helping maintain a smooth and quiet ride with an optimized contact patch for even wear and longer tread life.', 'tirerack', 'STATE COLLEGE, PA', 'https://www.google.com/maps?q=-33.9249,18.4241&hl=es;z=14&output=embed', 'https://www.tirerack.com/tires/tires.jsp?tireMake=Continental&tireModel=ExtremeContact+DWS+06+Plus&partnum=245WR7DWS06P&vehicleSearch=false&fromCompare1=yes', 1, '', '2025-04-05 20:10:29'),
(3, 'Michelin', 'Michelin Pilot Sport 4S', 548.00, 22, '205/55R16', 'Pilot', 225, 30, 20, '', 'Civic', 'EX', 'https://cdn.discounttire.com/sys-master/images/hca/hc5/9562247626782/mmihz8_ang_l.jpg,https://cdn.discounttire.com/sys-master/images/h9b/h66/9492894482462/PRODUCT_202010270454_tire_42857_1000_front.png_dt-product-desktop,https://cdn.discounttire.com/sys-master/images/h22/h54/9492868857886/PRODUCT_202010270451_tire_42857_1000_side.png_dt-product-desktop', '{\n  \"treadwear\": \"300\",\n  \"traction\": \"AA\",\n  \"temperature\": \"A\",\n  \"section_width\": \"275 / 325\",\n  \"aspect_ratio\": \"35 / 30\",\n  \"rim_diameter\": \"21\\\"\",\n  \"overall_diameter\": \"28.5\\\" / 28.7\\\"\",\n  \"rim_width_range\": \"9.0\\\" - 11.0\\\" / 10.5\\\" - 12.5\\\"\",\n  \"weight\": \"31.79 LBS / 33.93 LBS\",\n  \"tread_depth\": \"9/32\\\"\",\n  \"load_index\": \"103 / 108\",\n  \"load_range\": \"XL\",\n  \"max_psi\": \"50 PSI\",\n  \"speed_rating\": \"Up to 186 mph\",\n  \"sidewall_description\": \"Black Side Wall\",\n  \"warranty\": \"30000\",\n  \"vpn\": \"09857 / 43501\",\n  \"gtin\": \"086699098573 / 086699435019\"\n}\n', 'It very well could be the best overall performance tire out there. Welcome to the Michelin Pilot Sport 4S.  Michelin Pilot Sport 4S Features Think about the most powerful, performance-oriented vehicles out there right now. It doesn\'t matter whether they\'re exotic, electric, rare or expensive. Try to catch a glimpse of the sidewall of its tires at a stop light or when they’re parked—you\'ll probably see Pilot Sport 4S.  But why is the PS4S so popular?  Sure, Michelin has a well-established reputation for quality backing up its performance and racing pedigree across all Pilot Sport tires, but the Pilot Sport 4S has a number of standout features that make it the go-to max performance summer tire for drivers (and automotive manufacturers as an original equipment tire) that require livable comfort and leading performance.  And now that you\'re here, take a look at the tread on the Michelin PS4S.  It looks ready for a day at the track, but can keep you planted around town under hard cornering, braking or launching while providing superb daily driving manners when it comes to noise, vibration and harshness and wet road conditions.', 'discount Tyre', '1910 N Power Rd, Mesa, AZ 85205, USA', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3333.899231539919!2d-111.6848341!3d33.4504321!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x872ba540b843d84f%3A0x7092e86ce0149f0a!2s1910%20N%20Power%20Rd%2C%20Mesa%2C%20AZ%2085205%2C%20USA!5e0!3mhttps://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3333.899231539919!2d-111.6848341!3d33.4504321!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x872ba540b843d84f%3A0x7092e86ce0149f0a!2s1910%20N%20Power%20Rd%2C%20Mesa%2C%20AZ%2085205%2C%20USA!5e0!3m2!1sen!2sin!4v1712311234567!5m2!1sen!2sin', 'https://www.discounttire.com/buy-tires/michelin-pilot-sport-4s/p/42857/rearProduct/42863#treadwell-data', 0, '', '2025-04-05 22:04:32'),
