(390, 'Ironman', 'Ironman Polar Trax Gen2', 54.36, 0, '175/70R14 - 84T', '', 175, 70, 14, '', '', '', '', '{\"runFlat\":\"No\",\"plyRating\":\"SL\",\"speedRating\":\"T\",\"loadIndex\":\"84\",\"maxTirePressure\":\"44\",\"maxLoad\":\"1102@44\",\"loadSpeedRating\":\"84T\",\"approvedRimWidth\":\"4.5 - 6.0\",\"treadDepth\":\"12\"}', 'Introducing the Ironman Polar Trax Gen2 Tire<br><br>The Ironman Polar Trax Gen2 is a reliable winter tire designed to tackle harsh cold-weather conditions with ease. Engineered for passenger cars, SUVs, and light trucks, this tire offers exceptional grip, control, and safety on snow, ice, and slush-covered roads. Whether you\'re navigating city streets or rural highways, the Polar Trax Gen2 ensures confidence in every winter journey.<br><br>Key Features:<br><br>Directional Tread Design: Optimized for efficient water and slush evacuation, improving traction and stability on wet and icy roads.<br><br>Winter-Optimized Block Arrangement: Features specially arranged tread blocks that enhance grip and braking performance on snow and ice, providing improved handling in severe conditions.<br><br>Studdable Design: Optional stud placement for maximum grip on ice, delivering improved performance in the most extreme winter conditions.<br><br>Note: Studs sold separately at your local tire dealer.<br><br>Enhanced Siping Technology: Increases the number of biting edges for better handling and braking on slick surfaces.<br><br>Durable Compound: Specially formulated for cold weather to maintain flexibility, ensuring reliable performance and longer tread life.<br><br>Quiet and Comfortable Ride: Optimized tread design minimizes road noise, providing a smooth and comfortable winter driving experience.<br><br>Available Sizes and Fitment:<br><br>The Ironman Polar Trax Gen2 is available in a variety of sizes to accommodate passenger cars, SUVs, and light trucks, offering a versatile solution for winter driving needs.<br><br>Stay safe and in control this winter with the Ironman Polar Trax Gen2, a tire designed to deliver dependable performance in the toughest conditions.<br><br>', 'tirebuyer', '', '', 'https://www.tirebuyer.com/tires/ironman/polar-trax-gen2/p/style/855581', 0, 'brand', '2025-05-02 08:53:58'),
(391, 'Ironman', 'Ironman iMove', 88.00, 0, '195/65R15 - 91H', 'Black Wall', 195, 65, 15, '', '', '', 'https://tirebuyer.com/product-images/30-ironman/441-imove/vary_crop/webp/1000x1000/ironman_imove_bw_69667_vary_1742473679854.webp,https://tirebuyer.com/product-images/30-ironman/441-imove/vary/webp/1000x1000/ironman_imove_bw_69667_vary_1742471355600.webp', '{\"runFlat\":\"No\",\"sideWall\":\"Black Wall\",\"plyRating\":\"SL\",\"speedRating\":\"H\",\"loadIndex\":\"91\",\"maxTirePressure\":\"44\",\"maxLoad\":\"1356@44\",\"loadSpeedRating\":\"91H\",\"approvedRimWidth\":\"5.5 - 7.0\",\"sidewallColor\":\"Black Wall\",\"treadDepth\":\"10\"}', 'Introducing the Ironman iMove, a premium tire designed to elevate your driving experience to new heights. Engineered with cutting-edge technology and superior craftsmanship, the Ironman iMove offers a perfect blend of performance, comfort, and reliability, making it an ideal choice for discerning drivers who crave excellence on the road.<br><br>Designed to excel in both wet and dry conditions, the Ironman iMove utilizes an advanced silica-infused tread compound that provides exceptional traction and grip. Whether you\'re navigating through rainy streets or enjoying a thrilling ride on a sunny day, this tire delivers enhanced control and confidence, ensuring your safety remains the top priority.<br><br>The innovative tread pattern of the Ironman iMove is optimized to deliver a smooth and comfortable ride. Its precision-engineered grooves efficiently channel away water, reducing the risk of hydroplaning and enhancing overall stability. You can now drive with peace of mind, knowing that the Ironman iMove has your back even in challenging weather conditions.<br><br>Durability is a key feature of the Ironman iMove. Constructed with high-quality materials and reinforced with advanced sidewall protection, this tire offers excellent resistance to wear, cuts, and punctures. You can expect long-lasting performance and extended tread life, allowing you to go the extra mile without compromising on safety or performance.<br><br>Not only does the Ironman iMove excel in performance, but it also boasts a sleek and stylish design that enhances the overall appearance of your vehicle. Its modern and sporty aesthetic adds a touch of sophistication to your ride, making heads turn wherever you go.<br><br>Choose the Ironman iMove, and experience the pinnacle of tire engineering. With its outstanding performance, reliable traction, and durability, this tire is the perfect companion for drivers seeking the ultimate driving experience. Whether you\'re commuting to work, embarking on a road trip, or simply enjoying the thrill of the open road, the Ironman iMove will deliver an exceptional ride every time. Trust in Ironman to elevate your driving to new heights.<br>', 'tirebuyer', '', '', 'https://www.tirebuyer.com/tires/ironman/imove/p/style/69667', 0, 'brand', '2025-05-02 08:53:58'),
