(533, 'Yokohama', 'Yokohama Avid Ascend GT', 215.99, 0, '235/60R18XL - 107V', '', 235, 60, 18, '', '', '', 'https://tirebuyer.com/product-images/117-yokohama/2350-avid_ascend_gt/vary_crop/webp/1000x1000/yokohama_avidascendgt_bw_771499_vary_1742473682429.webp,https://tirebuyer.com/product-images/117-yokohama/2350-avid_ascend_gt/tread/webp/1000x1000/yokohama_avidascendgt_bw_771499_tread_1742474036896.webp,https://tirebuyer.com/product-images/117-yokohama/2350-avid_ascend_gt/vary/webp/1000x1000/yokohama_avidascendgt_bw_771499_vary_1742471358600.webp,https://tirebuyer.com/product-images/117-yokohama/2350-avid_ascend_gt/side/webp/1000x1000/yokohama_avidascendgt_bw_771499_sidewall_1742550451593.webp', '{\"runFlat\":\"No\",\"plyRating\":\"XL\",\"speedRating\":\"V\",\"loadIndex\":\"107\",\"maxTirePressure\":\"50\",\"maxLoad\":\"2149@50\",\"loadSpeedRating\":\"107V\",\"approvedRimWidth\":\"6.5 - 8.5\",\"treadDepth\":\"12\"}', 'Introducing the Yokohama Avid Ascend GT, the pinnacle of tire performance and reliability. Designed to deliver an exceptional driving experience, this tire is engineered with cutting-edge technology and superior craftsmanship to provide unmatched comfort, handling, and longevity.<br><br>The Avid Ascend GT is built to conquer any road condition with confidence. Its advanced all-season tread compound ensures excellent traction on both wet and dry surfaces, offering exceptional grip and stability. Whether you\'re navigating rain-soaked highways or winding mountain roads, this tire keeps you firmly in control, enhancing your driving pleasure and safety.<br><br>Featuring Yokohama\'s innovative Tapered Groove Technology, the Avid Ascend GT effectively evacuates water from the tire\'s footprint, reducing the risk of hydroplaning and maintaining optimal contact with the road. This technology enhances wet weather performance, providing you with peace of mind even in challenging weather conditions.<br><br>The Avid Ascend GT is designed for extended tread life, allowing you to enjoy its performance for an extended period. Its durable construction and optimized tread pattern contribute to even wear, ensuring that you get the most out of your investment. With this tire, you can confidently embark on long journeys, knowing that it will go the distance with you.<br><br>Furthermore, the Avid Ascend GT offers a quiet and comfortable ride. Yokohama\'s advanced noise reduction technology minimizes road noise, allowing you to enjoy a peaceful and serene driving experience. Whether you\'re cruising down the highway or maneuvering through busy city streets, this tire provides a refined and comfortable ride that enhances your overall driving pleasure.<br><br>As a testament to its quality and reliability, the Yokohama Avid Ascend GT comes backed by a robust warranty. Yokohama is known for its commitment to excellence, and this tire is no exception. You can trust in its performance and dependability, making it an excellent choice for drivers seeking a tire that delivers on all fronts.<br><br>Upgrade your driving experience with the Yokohama Avid Ascend GT. Its exceptional performance, longevity, and comfort make it the perfect tire for discerning drivers who demand the best. Choose Yokohama and experience the difference in tire engineering and craftsmanship.', 'tirebuyer', '', '', 'https://www.tirebuyer.com/tires/yokohama/avid-ascend-gt/p/TV00721506327568', 0, 'size', '2025-05-05 07:05:52'),
