(653, 'Goodyear', 'Goodyear Eagle RS-A 93V', 111.96, 0, '', '', 0, 0, 0, '', '', '', 'https://images.simpletire.com/images/q_auto/line-images/1087/1087-sidetread/goodyear-eagle-rs-a.png,https://images.simpletire.com/images/q_auto/line-images/1087/1087-sidewall/goodyear-eagle-rs-a.png,https://images.simpletire.com/images/q_auto/line-images/1087/1087-treadfull/goodyear-eagle-rs-a.png,https://images.simpletire.com/images/q_auto/line-images/1087/1087-treadonly/goodyear-eagle-rs-a.png', '{\"warranty\":\"No mileage warranty\"}', 'The Goodyear Eagle RS-A is an all-season tire designed for sedans, coupes, minivans, and crossovers that features an asymmetric tread with wide lateral grooves, a reinforced shoulder, and steel belted construction.\n\n<br/><br/><b>Features & Benefits</b><br/><ul><li>All-season tread</li><li>Black sidewall</li><li>Advanced network of sipes for optimal winter traction</li><li>Reinforced shoulder tread blocks provide superb handling</li></ul> The Goodyear Eagle RS-A is an all-season tire that offers durability and sharp handling, making it a choice of law-enforcement agencies nationwide. Its asymmetric tread and reinforced shoulders deliver crisp and refined cornering and steering response, and wide lateral grooves evacuate water from the tire\'s contact patch to resist hydroplaning. In addition, the Eagle RS-A has a dense pattern of sipes that multiplies winter grip and an H speed rating (130 mph).', 'simpletire', '', '', 'https://simpletire.com/brands/goodyear-tires/eagle-rs-a', 0, 'brand', '2025-05-05 07:16:14'),
(654, 'Goodyear', 'Goodyear Eagle Sport All-Season 94V', 142.96, 0, '', '', 0, 0, 0, '', '', '', 'https://images.simpletire.com/images/q_auto/line-images/8416/8416-sidetread/goodyear-eagle-sport-all-season.png,https://images.simpletire.com/images/q_auto/line-images/8416/8416-sidewall/goodyear-eagle-sport-all-season.png,https://images.simpletire.com/images/q_auto/line-images/8416/8416-treadfull/goodyear-eagle-sport-all-season.png,https://images.simpletire.com/images/q_auto/line-images/8416/8416-treadonly/goodyear-eagle-sport-all-season.png', '{\"warranty\":\"50k mile warranty\"}', '', 'simpletire', '', '', 'https://simpletire.com/brands/goodyear-tires/eagle-sport-all-season', 0, 'brand', '2025-05-05 07:16:14'),
