(656, 'Goodyear', 'Goodyear Assurance WeatherReady 95H', 110.96, 0, '', '', 0, 0, 0, '', '', '', 'https://images.simpletire.com/images/q_auto/line-images/13664/13664-sidetread/goodyear-assurance-weatherready.png,https://images.simpletire.com/images/q_auto/line-images/13664/13664-sidewall/goodyear-assurance-weatherready.png,https://images.simpletire.com/images/q_auto/line-images/13664/13664-treadfull/goodyear-assurance-weatherready.png,https://images.simpletire.com/images/q_auto/line-images/13664/13664-treadonly/goodyear-assurance-weatherready.png', '{\"warranty\":\"60k mile warranty\"}', 'The Goodyear Assurance WeatherReady is an all-weather tire that\'s designed for use on passenger vehicles and offers drivers all weather traction, enhanced grip in wet, snowy, and icy roads, and quiet, comfortable ride paired with a 60,000 miles limited manufacturer tread life warranty. \n\n<br/><br/><b>Features & Benefits</b><br/><ul><li>All-weather tread</li><li>Black sidewall</li><li>60,000 mile limited manufacturer tread life warranty</li><li>Three Peak Mountain Snowflake certified for use in moderate to severe winter weather conditions</li><li>Features a specialized rubber compound that enhances grip on wet, snowy, and icy roads</li></ul> If you are looking for a set of tires that can perform well throughout the year in wet, dry, and winter weather, then all-weather tires might be the right fit for you. Take a look at the Goodyear Assurance WeatherReady, an all-weather tire that\'s built with Weather Reactive Technology to enhance traction on wet roads. The tire also features soybean oil in its rubber compound that helps in maintaining a grip on the road when the temperature drops. These tires are Three Peak Mountain Snowflake certified for use in moderate to severe winter weather conditions, ensuring an excellent overall performance, and making them a great choice for vehicles like the Chevrolet Cruze, Dodge Caravan, Ford Escape, Hyundai Sonata, Honda CR-V, Kia Telluride, Mazda3, Nissan Rogue, Toyota Sienna, Volkswagen Atlas, and many others.', 'simpletire', '', '', 'https://simpletire.com/brands/goodyear-tires/assurance-weatherready', 0, 'brand', '2025-05-05 07:16:14'),
