(661, 'Pirelli', 'Pirelli Scorpion All Season Plus 3', 182.26, 0, '225/65R17 - 102H', 'Black Wall', 225, 65, 17, '', '', '', 'https://tirebuyer.com/product-images/75-pirelli/1369-scorpion_all_season_plus_3/vary_crop/webp/1000x1000/pirelli_scorpionallseasonplus3_bw_995601_vary_1742473681508.webp,https://tirebuyer.com/product-images/75-pirelli/1369-scorpion_all_season_plus_3/tread/webp/1000x1000/pirelli_scorpionallseasonplus3_bw_995601_tread_1742474036213.webp,https://tirebuyer.com/product-images/75-pirelli/1369-scorpion_all_season_plus_3/vary/webp/1000x1000/pirelli_scorpionallseasonplus3_bw_995601_vary_1742471357568.webp,https://tirebuyer.com/product-images/75-pirelli/1369-scorpion_all_season_plus_3/side/webp/1000x1000/pirelli_scorpionallseasonplus3_bw_995601_sidewall_1742550450862.webp', '{\"performanceCategory\":\"SUV\\/Crossover All-Season\",\"runFlat\":\"No\",\"sideWall\":\"Black Wall\",\"plyRating\":\"SL\",\"speedRating\":\"H\",\"loadIndex\":\"102\",\"warranty\":\"70K\",\"maxTirePressure\":\"44\",\"maxLoad\":\"1874@44\",\"loadSpeedRating\":\"102H\",\"approvedRimWidth\":\"6.0 - 8.0\",\"sidewallColor\":\"Black Wall\",\"treadDepth\":\"11\"}', 'Introducing the Pirelli Scorpion All Season Plus 3 Tire<br><br>The Pirelli Scorpion All Season Plus 3 is a grand touring all-season tire designed specifically for crossovers, SUVs, and light trucks. Engineered to deliver outstanding comfort, reliability, and performance, this tire ensures exceptional handling in diverse weather conditions while offering a quiet and comfortable ride.<br><br>Key Features:<br><br>All-Season Performance: Designed to provide consistent grip and handling on wet, dry, and light snow-covered roads, ensuring year-round confidence.<br><br>Asymmetric Tread Design: Enhances cornering stability, promotes even tread wear, and improves steering response for superior driving control.<br><br>Next-Generation Tread Compound: Features advanced silica-infused rubber for enhanced traction, longer tread life, and improved fuel efficiency.<br><br>Comfort Optimization: Engineered with noise-reduction technology to minimize road noise, delivering a smooth and quiet ride.<br><br>Wide Circumferential Grooves: Effectively channel water away from the tire to reduce hydroplaning risk and improve wet road grip.<br><br>Durability and Longevity: Reinforced construction ensures reliable performance and extended tire life, even under heavy loads.<br><br>Available Sizes and Fitment:<br><br>The Pirelli Scorpion All Season Plus 3 is available in a wide range of sizes to fit crossovers, SUVs, and light trucks. Contact your local tire retailer to find the right size for your vehicle.<br><br>For drivers seeking a versatile, high-performing tire with year-round dependability, the Pirelli Scorpion All Season Plus 3 is an excellent choice for grand touring all-season comfort and capability.<br><br>', 'tirebuyer', '', '', 'https://www.tirebuyer.com/tires/pirelli/scorpion-all-season-plus-3/p/style/995601', 0, 'brand', '2025-05-05 07:16:47'),
