(874, 'Yokohama', 'Yokohama Avid Ascend GT', 144.99, 40, '215-55r16', 'Blackwall sidewall', 215, 55, 16, 'Saab', '9-3', '2-0t-sedan', 'https://images.simpletire.com/images/q_auto/line-images/16079/16079-sidetread/yokohama-avid-ascend-gt.png,https://images.simpletire.com/images/q_auto/line-images/16079/16079-sidewall/yokohama-avid-ascend-gt.png,https://images.simpletire.com/images/q_auto/line-images/16079/16079-treadfull/yokohama-avid-ascend-gt.png,https://images.simpletire.com/images/q_auto/line-images/16079/16079-treadonly/yokohama-avid-ascend-gt.png', '{\"warranty\":\"65k mile warranty\",\"Speed Rating\":\"H speed rating\",\"Load Range\":\"XL load range\",\"Load Index\":\"97 (1609 lbs) load index\",\"UTQG\":\"740AA utqg\",\"SideWall\":\"Blackwall sidewall\"}', 'The Yokohama Avid Ascend GT is an all-season tire designed for use on performance cars, sedans, CUVs, and minivans, and offers driver shorter braking distance in rain and snow and a comfortable ride along with an up to 65,000 mile limited manufacturer tread life warranty.\n\n<br/><br/><b>Features & Benefits</b><br/><ul><li>All-season tread</li><li>Black sidewall</li><li>65,000 mile limited manufacturer tread life warranty for Non-staggered fitments and Front Position tires used in staggered fitments, and 32,500 mile limited manufacturer tread life warranty for Rear Positions tire used in staged fitment applications.</li><li>Special rubber compound within the tread provides excellent grip in wet and light winter weather conditions</li></ul> If you are someone who commutes daily and wants a set of tires that can ensure great grip and responsive handling in wet or light winter weather conditions, then the Yokohama Avid Ascend GT might be the perfect fit for you. Designed to deliver excellent all-season performance, shorter braking distance, and sporty handling, the Avid Ascend GT comes with a notched block tread design with hundreds of 3D sipes for extra grip, especially in light winter weather. The all-new TriBlend rubber compound further boosts wet braking and reduces braking distance. Additionally, the unique tread of the tire helps to offer a quiet, comfortable ride and the optimized contact patch puts more rubber on the road to ensure that the Avid Ascend GT has a long lifespan.', 'simpletire', '', '', 'https://simpletire.com/brands/yokohama-tires/avid-ascend-gt#v=1&tireSize=215-55r-16&mpn=110132715&pageSource=vehicleCatalog&itemId=175395&curationSource=best-customer-rated&vehicleMake=saab&vehicleModel=9-3&vehicleYear=2006&oem=63716&vehicleTrim=2-0t-seda', 0, 'model', '2025-05-14 00:43:31'),
