(877, 'Toyo', 'Toyo Extensa HP II', 116.94, 0, '215-55r16', 'Blackwall sidewall', 215, 55, 16, 'Saab', '9-3', '2-0t-sedan', 'https://images.simpletire.com/images/q_auto/line-images/15059/15059-sidetread/toyo-extensa-hp-ii.png,https://images.simpletire.com/images/q_auto/line-images/15059/15059-sidewall/toyo-extensa-hp-ii.png,https://images.simpletire.com/images/q_auto/line-images/15059/15059-treadfull/toyo-extensa-hp-ii.png,https://images.simpletire.com/images/q_auto/line-images/15059/15059-treadonly/toyo-extensa-hp-ii.png', '{\"warranty\":\"45k mile warranty\",\"Speed Rating\":\"V speed rating\",\"Load Range\":\"XL load range\",\"Load Index\":\"97 (1609 lbs) load index\",\"UTQG\":\"500AA utqg\",\"SideWall\":\"Blackwall sidewall\"}', 'The Toyo Extensa HP II is an all-season tire that\'s designed for use on passenger cars, coupes, and luxury cars, and offers drivers good braking performance, strong wet handling, solid year-round traction, and a 45,000 mile limited manufacturer tread life warranty.\n\n<br/><br/><b>Features & Benefits</b><br/><ul><li>All-season tread</li><li>Black sidewall</li><li>45,000 mile limited manufacturer tread life warranty</li><li>Backed by Toyo\'s 500-Mile or 45-Day Trial, and Mileage Warranty (restrictions and limitations apply)</li><li>The innovative, high-silica rubber compound ensures improved wet traction and longer service life</li></ul> Drivers want to feel confident while driving year-round, especially in wet conditions. Fortunately for them, the Toyo Extensa HP II comes as a great choice and utilizes a special rubber compound and new-gen tread design that enables vehicles to stop short in wet conditions, braking 31 feet sooner than its predecessor. This tire is suitable for use on most coupes and passenger sedans, and offers drivers the perfect balance of dynamic styling, high quality, and great performance. The multi-wave sipes of the Extensa HP II reduce irregular wear for quieter rides, while the directional tread pattern improves ride comfort by decreasing tread noise levels. Additionally, the tread of the Extensa HP II sports staggered tread blocks that boost handling and traction performance, making the tire an ideal option for use on vehicles like the Toyota Corolla, Honda Accord, Ford Mustang, Chevrolet Camaro, Mazda MX-5, and Mercedes-Benz C-Class.', 'simpletire', '', '', 'https://simpletire.com/brands/toyo-tires/extensa-hp-ii#v=1&tireSize=215-55r-16&mpn=196430&pageSource=vehicleCatalog&itemId=163257&curationSource=best-customer-rated&vehicleMake=saab&vehicleModel=9-3&vehicleYear=2006&oem=63716&vehicleTrim=2-0t-sedan&curati', 0, 'model', '2025-05-14 00:43:31'),
