(889, 'Kelly', 'Kelly Edge A/S', 214.96, 16, '', 'Blackwall sidewall', 255, 55, 20, 'Buick', 'Enclave', 'leather', 'https://images.simpletire.com/images/q_auto/line-images/11339/11339-sidetread/kelly-edge-a-s.png,https://images.simpletire.com/images/q_auto/line-images/11339/11339-sidewall/kelly-edge-a-s.png,https://images.simpletire.com/images/q_auto/line-images/11339/11339-treadfull/kelly-edge-a-s.png,https://images.simpletire.com/images/q_auto/line-images/11339/11339-treadonly/kelly-edge-a-s.png', '{\"warranty\":\"55k mile warranty\",\"Speed Rating\":\"H speed rating\",\"Load Range\":\"SL load range\",\"Load Index\":\"107 (2150 lbs) load index\",\"UTQG\":\"500AB utqg\",\"SideWall\":\"Blackwall sidewall\"}', 'Designed for use on sedans, CUVs, and SUVs, the Edge A/S is an all season tire that offers drivers traction on dry, wet, and snowy roads along with a 55,000 mile limited tread life warranty.\n\n<br/><br/><b>Features & Benefits</b><br/><ul><li>All-season tread</li><li>Black sidewall</li><li>55,000 mile limited manufacturer tread life warranty</li><li>Features sturdy tread blocks that promote a long tread life</li></ul> Whether taking the kids to practice or simply commuting to work, drivers of sedans, CUVs, and SUVs need a tire that offers dependable year round performance. Fortunately, Kelly designed the Edge A/S to do just that with a long tread life. Biting tread block edges give drivers traction in wet, dry, and snowy conditions, and the Edge A/S also featured broad grooves that evacuate water and slush for enhanced grip. Built with a proven tread pattern to boost handling, the Edge A/S features sturdy tread blocks that promote a long tread life to further strengthen its value.', 'simpletire', '', '', 'https://simpletire.com/brands/kelly-tires/edge-a-s#v=1&tireSize=255-55r-20&mpn=356896030&pageSource=vehicleCatalog&itemId=199416&curationSource=best-customer-rated&vehicleMake=buick&vehicleModel=enclave&vehicleYear=2017&oem=145229&vehicleTrim=leather&cura', 0