(980, 'Pirelli', 'Pirelli Scorpion STR 102H', 145.96, 0, '', '', 0, 0, 0, '', '', '', 'https://images.simpletire.com/images/q_auto/line-images/2001/2001-sidetread/pirelli-scorpion-str.png,https://images.simpletire.com/images/q_auto/line-images/2001/2001-sidewall/pirelli-scorpion-str.png,https://images.simpletire.com/images/q_auto/line-images/2001/2001-treadfull/pirelli-scorpion-str.png,https://images.simpletire.com/images/q_auto/line-images/2001/2001-treadonly/pirelli-scorpion-str.png', '{\"warranty\":\"65k mile warranty\"}', 'The Pirelli Scorpion STR is an all-season tire thatâ€™s designed for use on CUVs, SUVs, and light trucks, and offers drivers balanced on- and off-road performance, better ride comfort, and great year-round traction along with an up to a 65,000 mile limited manufacturer tread life warranty.\n\n<br/><br/><b>Features & Benefits</b><br/><ul><li>All-season tread with moderate off-road capabilities</li><li>Black sidewall</li><li>65,000 mile limited manufacturer tread life warranty for non-Original Equipment, LT sizes, or Commercial uses</li><li>Optimized tread design improves handling performance and reduces tread noise levels for a pleasant driving experience.</li></ul> Made for use on CUVs, SUVs, and light trucks, the Pirelli Scorpion STR offers solid year-round performance in dry, wet, and light winter weather conditions. This all-season tire allows the drivers to cruise and maneuver on the highways with greater confidence by putting more rubber on the road, while its innovative tread design features inclined blocks with detailed siping to improve traction, handling, steering, and braking response in different terrain conditions. The continuous center rib of the Scorpion STR ensures uniform treadwear for longer tread life and also significantly boosts ride comfort by reducing the tread noise levels and absorbing road vibrations. Additionally, the use of an advanced compound that utilizes silica and natural rubber increases the Scorpion STRâ€™s traction and grip on wet as well as light snow conditions, making it a reliable companion for vehicles like the Ford F-150, Chevrolet Suburban, Toyota 4Runner, Nissan Pathfinder, Dodge RAM 1500, GMC Canyon, Hummer H3, Jeep Wrangler, Land Rover Defender, and Lincoln Navigator.', 'simpletire', '', '', 'https://simpletire.com/brands/pirelli-tires/scorpion-str', 0, 'brand', '2025-05-15 04:26:28'),
