(986, 'Toyo', 'Toyo Open Country R/T', 414.99, 0, '315-70r17', 'Blackwall sidewall', 0, 70, 17, 'Ford', 'Bronco', 'outer-banks-w-sasquatch-pkg', 'https://images.simpletire.com/images/q_auto/line-images/10781/10781-sidetread/toyo-open-country-r-t.png,https://images.simpletire.com/images/q_auto/line-images/10781/10781-sidewall/toyo-open-country-r-t.png,https://images.simpletire.com/images/q_auto/line-images/10781/10781-treadfull/toyo-open-country-r-t.png,https://images.simpletire.com/images/q_auto/line-images/10781/10781-treadonly/toyo-open-country-r-t.png', '{\"warranty\":\"45k mile warranty\",\"Speed Rating\":\"S speed rating\",\"Load Range\":\"C load range\",\"Load Index\":\"113 (2535 lbs) load index\",\"UTQG\":\" utqg\",\"SideWall\":\"Blackwall sidewall\"}', 'The Toyo Open Country R/T is a rugged-terrain tire that is designed for use on full-sized pickups, and offers drivers great traction, aggressive styling, a quiet ride plus a 45,000 mile limited manufacturer tread life warranty.\n\n<br/><br/><b>Features & Benefits</b><br/><ul><li>Rugged-terrain tread</li><li>Black sidewall</li><li>45,000 mile limited manufacturer tread life warranty</li><li>Open, scalloped shoulder blocks provide better traction in muddy, sandy, or snowy off-road conditions</li></ul> Rugged-terrain tires are designed for drivers who want to wander off the beaten path while still maintaining on-road civility. Whether you are an off-road enthusiast or just want to explore the trails once a month, the Toyo Open Country R/T combines off-road qualities with on-road skills to create a tire that can handle every driving environment. The Open Country R/T features a high-turn up polyester construction that contributes to great durability, impact resistance, and handling, as well as stone and mud ejectors that remove mud and stone from the grooves to keep tread clean. Its aggressive sidewall with a durable rubber compound and open scalloped shoulder blocks enhance off-road traction, specifically in muddy, sandy, or snowy conditions. While the Open Country R/T\'s dual sidewall design gives it two distinct appearances that can be customized, its optimized tread pattern reduces noise for increased on-road comfort. Designed for use on full-sized pickup trucks, the Toyo Open Country R/T is a great choice for vehicles like the Chevrolet Silverado 1500, Ford F-250, Jeep Wrangler, Nissan Titan, RAM 1500, and Toyota Tacoma.', 'simpletire', '', '', 'https://simpletire.com/brands/toyo-tires/open-country-r-t#v=1&tireSize=lt315-70r-17&mpn=353550&pageSource=vehicleCatalog&itemId=193127&curationSource=best-customer-rated&vehicleMake=ford&vehicleModel=bronco&vehicleYear=2023&oem=184673&vehicleTrim=outer-ba', 0, 'model', '2025-05-15 04:45:46'),
