(994, 'Lexani', 'Lexani LX-Twenty', 115.96, 28, '225-55r19', 'Blackwall sidewall', 0, 55, 19, 'Ford', 'Mustang Mach-E', 'premium', 'https://images.simpletire.com/images/q_auto/line-images/12076/12076-sidetread/lexani-lx-twenty.png,https://images.simpletire.com/images/q_auto/line-images/12076/12076-sidewall/lexani-lx-twenty.png,https://images.simpletire.com/images/q_auto/line-images/12076/12076-treadfull/lexani-lx-twenty.png,https://images.simpletire.com/images/q_auto/line-images/12076/12076-treadonly/lexani-lx-twenty.png', '{\"warranty\":\"55k mile warranty\",\"Speed Rating\":\"V speed rating\",\"Load Range\":\"XL load range\",\"Load Index\":\"103 (1929 lbs) load index\",\"UTQG\":\"320AA utqg\",\"SideWall\":\"Blackwall sidewall\"}', 'The Lexani LX-Twenty is an ultra high-performance all-season tire that\'s designed for sports cars and performance-oriented coupes and sedans, and offers drivers excellent handling, enduring tread life, great traction at high speeds, and a 45,000 mile limited manufacturer tread life warranty.\n\n<br/><br/><b>Features & Benefits</b><br/><ul><li>Ultra-high-performance all-season tread</li><li>Black sidewall</li><li>45,000 mile limited manufacturer tread life warranty</li><li>Optimized construction reduces road noises and vibrations to create a quiet, comfortable ride</li><li>Designed for use in warmer weather conditions; should not be used when temperatures are consistently below 45 degrees Fahrenheit</li></ul> Designed for sporty handling, the Lexani LX-Twenty is a premium ultra-high-performance all-season tire that can be used on sports and performance cars. The LX-Twenty offers excellent handling and cornering performance at high speeds, both in wet and dry conditions. Its innovative tread pattern combines an asymmetrical design to ensure optimal performance. Additionally, you get a 45,000 mile limited mileage warranty. All in all, the Lexani LX-Twenty combines performance, longevity, and traction, making it a great choice for enthusiasts seeking an affordable high-performance tire. Ideal for use on a wide range of vehicles, the LX-Twenty is a natural fit for vehicles like the Audi A6, BMW M3, Dodge Charger, Ford Mustang, Honda Civic, and many more.', 'simpletire', '', '', 'https://simpletire.com/brands/lexani-tires/lx-twenty#v=1&tireSize=p225-55r-19&mpn=lxst201955020&pageSource=vehicleCatalog&itemId=214547&curationSource=best-customer-rated&vehicleMake=ford&vehicleModel=mustang-mach-e&vehicleYear=2022&oem=178816&vehicleTrim', 0, 'model', '2025-05-16 05:57:49'),
